import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Badge, BreadcrumbItem, Breadcrumb } from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div>
        <Breadcrumb>
          <BreadcrumbItem>
            <a href="/">Home</a>
          </BreadcrumbItem>
          <BreadcrumbItem>
            <a href="/items">Library</a>
          </BreadcrumbItem>
          <BreadcrumbItem active>Data</BreadcrumbItem>
        </Breadcrumb>
      </div>
    );
  }
}

export default Header;
